import React from "react";
import Button from "@material-ui/core/Button";

const navbar = props => {
  const storedAircraftButtonHandler = () => {
    if (props.storedAircraft === "") {
      return (
        <Button variant="contained" disabled>
          Stored
        </Button>
      );
    } else {
      return (
        <Button
          variant="contained"
          color="primary"
          onClick={props.refuseEmptyStoredAircraftHandler}
        >
          Stored
        </Button>
      );
    }
  };

  if (props.showStoreAircraft) {
    return (
      <Button
        variant="contained"
        color="secondary"
        onClick={props.confirmResetWindow}
      >
        Reset
      </Button>
    );
  }

  if (props.submitted === false) {
    return (
      <div className="button-cont">
        {storedAircraftButtonHandler()}
        <Button
          variant="contained"
          color="primary"
          onClick={props.preventNaNHandler}
        >
          Submit
        </Button>
      </div>
    );
  }
};

export default navbar;
